import { Button } from 'react-bootstrap';

const HeaderComponent = () => (
  <nav className="shadow-sm navbar navbar-expand-lg navbar-dark bg-dark bg-gradient">
    <div className="col-12 col-md-50 p-0 d-flex align-items-center justify-content-center">
      <Button className="bg-dark bg-gradient">shipirdi</Button>
    </div>
  </nav>
);

export default HeaderComponent;
